import React from "react";
import Table from "react-bootstrap/Table";

const DashboardTables = () => {
  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>ID</th>
          <th>Name</th>
          <th>Description</th>
          <th>Amount $</th>
          <th>Time</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody></tbody>
    </Table>
  );
};

export default DashboardTables;
